sql:
SELECT `Crystal structure`, `No. of Cu-O planes in unit cell`
FROM `table_1_101336_1`
WHERE `T c (K)` > 100;

SELECT `Title`, COUNT(*) AS EpisodeCount
FROM `table_1_10470082_8`
GROUP BY `Title`;

SELECT `Species`, COUNT(*) AS `Total Count`, AVG(`Sepal length`) AS `Average Sepal Length`, AVG(`Sepal width`) AS `Average Sepal Width`, AVG(`Petal length`) AS `Average Petal Length`, AVG(`Petal width`) AS `Average Petal Width`
FROM `table_1_10477224_1`
GROUP BY `Species`;

SELECT `Institution`, `Location`, `Mens Nickname`, `Womens Nickname`, `Founded`, `Type`, `Enrollment`, `Joined`
    FROM (
        SELECT *, ROW_NUMBER() OVER(ORDER BY `Founded`) AS rn
        FROM (
            SELECT `Institution`, `Location`, `Mens Nickname`, `Womens Nickname`, `Founded`, `Type`, `Enrollment`, `Joined`
            FROM `table_1_10577579_2`
        ) AS t
    )
    WHERE rn BETWEEN 2 AND 7;

SELECT `Institution`, `Enrollment`, `Joined`, `Left`, `Current Conference`
    FROM `table_1_10577579_3`
    WHERE `Joined` < '2000' AND `Left` > '1990';

SELECT `Institution`, `Nickname`, `Location`, `Enrollment`
FROM `table_1_10581768_2`
WHERE `Founded` > 1923 AND `Enrollment` BETWEEN 1000 AND 2000;

SELECT `Title`, `U.S. viewers (millions)` - LAG(`U.S. viewers (millions)`) OVER (ORDER BY `No. in season`) AS `Viewing Drop`
    FROM `table_1_10935548_1`
    WHERE `No. in season` > 1;

SELECT `Area in km²`, (`Population at 2010 Census` * COUNT(`Number of settlements and villages`)) AS `Potential Population Growth`
    FROM `table_1_1104312_5`
    GROUP BY `Area in km²`;

SELECT T1.`Team` AS `Team`, T1.`Outgoing manager` AS `Outgoing Manager`, T1.`Manner of departure` AS `Manner of Departure`, T1.`Date of vacancy` AS `Date of Vacancy`, T1.`Replaced by` AS `Replaced By`, T1.`Date of appointment` AS `Date of Appointment`
     FROM `table_1_11206916_2` AS T1
     WHERE T1.`Date of vacancy` >= '2007-10-01' AND T1.`Date of appointment` <= '2008-03-31';

SELECT `Club`, `Position in 2012–13`, `First season in top division`, `Number of seasons in top division`, `Number of seasons in the Premier League`
FROM table_1_11250_4
WHERE `Number of seasons in top division` > 50 OR `Number of seasons in the Premier League` > 10;

SELECT `Round`, `Grand Prix`, `Pole Position`, `Fastest Lap`, `Winning Driver`, `Winning Constructor`
    FROM (
        SELECT *, ROW_NUMBER() OVER (PARTITION BY `Grand Prix` ORDER BY `Round`) AS rn
        FROM (
            SELECT `Round`, `Grand Prix`, `Pole Position`, `Fastest Lap`, `Winning Driver`, `Winning Constructor`
            FROM `table_1_1137695_3`
        ) AS ranked_rounds
    )
    WHERE rn = 1;

SELECT `model`, `max. motive power`, `max. torque at rpm`, `engine displacement`, `engine type`, `engine configuration & notes 0-100km/h`
FROM `table_1_1147705_1`
WHERE `model` IN ('2.0', '2.0T', '2.0 T5', '2.4', '2.5', '2.5T AWD', 'Base 2.4', 'Base 2.4 SE', 'GLT', '2.4 AWD', '2.3 T5');

SELECT T1.`Title`, T1.`Original air date`, T1.`U.S. viewers (million)` - LAG(T1.`U.S. viewers (million)`) OVER (ORDER BY T1.`No. in season`) AS `Viewers Change`
    FROM `table_1_11562143_1` AS T1
    ORDER BY T1.`No. in season`;

SELECT T1.`Player`, T1.`Position`, T1.`School`, T1.`Hometown`, T1.`MLB Draft`
    FROM `table_1_11677100_18` AS T1
    WHERE T1.`MLB Draft` LIKE '1st Round%' OR T1.`MLB Draft` LIKE '%Attended%';

SELECT `Series`, COUNT(`Monday`) AS Monday_Count, SUM(CASE WHEN `Tuesday` = '' THEN 0 ELSE 1 END) AS Tuesday_Count, SUM(CASE WHEN `Wednesday` = '' THEN 0 ELSE 1 END) AS Wednesday_Count, SUM(CASE WHEN `Thursday` = '' THEN 0 ELSE 1 END) AS Thursday_Count, SUM(CASE WHEN `Friday` = '' THEN 0 ELSE 1 END) AS Friday_Count, SUM(CASE WHEN `Saturday` = '' THEN 0 ELSE 1 END) AS Saturday_Count, SUM(CASE WHEN `Sunday` = '' THEN 0 ELSE 1 END) AS Sunday_Count
    FROM (
        SELECT `Series`, `Monday`, `Tuesday`, `Wednesday`, `Thursday`, `Friday`, `Saturday`, `Sunday`
        FROM `table_1_11748792_2`
    )
    GROUP BY `Series`;

SELECT `Player` AS `Player Name`, `Nationality` AS `Nationality`, `Club team` AS `Club Team`
    FROM `table_1_11803648_21`
    WHERE `Round` IN (1, 3);

SELECT `Institution`, `Location`, `Founded`, `Type`, `Enrollment`, `Nickname`, `Joined`
    FROM table_1_1183842_1
    WHERE `Founded` > (SELECT MIN(`Founded`) FROM table_1_1183842_1) AND `Joined` >= 1988;

SELECT `Year`, `Theme`, `Artist`, MAX(CASE WHEN `Mintage (Proof)` IS NOT NULL THEN `Mintage (Proof)` ELSE `Mintage (BU)[ clarification needed ]` END) AS Mintage, MAX(CASE WHEN `Issue Price (Proof)` IS NOT NULL THEN `Issue Price (Proof)` ELSE `Issue Price (BU)[ clarification needed ]` END) AS Issue_Price
    FROM `table_1_11916083_1`
    GROUP BY `Year`, `Theme`, `Artist`;

SELECT `Date`, `Team`, `Record`, `High points`, `High rebounds`, `High assists`, `Location Attendance` 
    FROM table_1_11960407_2 
    WHERE `Record` LIKE '%6–6%' OR `Record` LIKE '%6–7%';

SELECT T1.`Date`, T1.`Team`, T1.`Series`
    FROM `table_1_11964263_13` AS T1
    WHERE T1.`Series` IN ('1–0', '2–0', '2–1', '3–1');

SELECT `Year`, `Mens singles`, `Womens singles`
    FROM (
        SELECT `Year`, `Mens singles`, `Womens singles`, 
               ROW_NUMBER() OVER(ORDER BY `Year`) - COUNT(*) OVER() AS rn
        FROM (
            SELECT `Year`, `Mens singles`, `Womens singles`
            FROM `table_1_12171145_1`
        ) t
    )
    WHERE rn = 0;

SELECT `Country`, `Currency`, (`1 Euro =`) * (`1 USD =`) AS `Euro to USD Rate`
FROM table_1_1222653_10
WHERE `Central bank` LIKE 'Central Bank%';

SELECT `Season`, MAX(CASE WHEN `Mens singles` LIKE '%Bengt%' THEN `Mens singles` ELSE NULL END) AS MostRecentBengtWinner, MAX(CASE WHEN `Womens singles` LIKE '%Thyra%' THEN `Womens singles` ELSE NULL END) AS MostRecentThyraWinner
FROM table_1_12266757_1
GROUP BY `Season`;

SELECT `Athlete`, MAX(`Shooting`) AS `Best_Shooting`, MIN(`Swimming`) AS `Fastest_Swimming`
    FROM (
        SELECT `Athlete`, `Shooting`, `Swimming`
        FROM (
            SELECT `Athlete`, `Shooting`, `Swimming`, ROW_NUMBER() OVER(PARTITION BY `Athlete` ORDER BY `Shooting` DESC) AS `Shooting_Rank`, ROW_NUMBER() OVER(PARTITION BY `Athlete` ORDER BY `Swimming` ASC) AS `Swimming_Rank`
            FROM (
                SELECT `Athlete`, `Shooting`, `Swimming`
                FROM `table_1_12407546_2`
            )
        )
        WHERE `Shooting_Rank` = 1 AND `Swimming_Rank` = 1
    )
    GROUP BY `Athlete`;

SELECT `Main cast seasons`, `Portrayed by`, COUNT(*) AS Episode_Count
    FROM table_1_12441518_1
    GROUP BY `Main cast seasons`, `Portrayed by`
    HAVING Episode_Count = (
        SELECT MAX(Episode_Count) FROM (
            SELECT `Main cast seasons`, `Portrayed by`, COUNT(*) AS Episode_Count
            FROM table_1_12441518_1
            GROUP BY `Main cast seasons`, `Portrayed by`
        )
    );

SELECT `Name of System`, `Location`, `Traction Type`, MIN(`Date (From)`), MAX(`Date (To)`) 
FROM `table_1_12562214_1`
GROUP BY `Name of System`;

SELECT `Constituency`, `Total poll (%)`, `For (%)`, `Against (%)`
FROM table_1_1289762_1
WHERE `Against (%)` > (`For (%)` + 10) AND `Total poll (%)` >= 75;

SELECT `Complete Series`, (`Region 1` - `Region 2`) AS `Difference Region 1 vs 2`
    FROM `table_1_1337525_1`
    WHERE `Number Of Discs` = 2 AND `Region 1` IS NOT NULL AND `Region 2` IS NOT NULL;

SELECT `Club`, `Played`, `Won`, `Drawn`, `Lost`, `Points for`, `Points against`, `Tries for`, `Tries against`, `Try bonus`, `Losing bonus`, `Points`
    FROM `table_1_13399573_3`
    WHERE `Points` = (SELECT MAX(`Points`) FROM `table_1_13399573_3`);

SELECT `Club`, SUM(`Played`) AS Total_Plays, SUM(`Won`) AS Total_Wins, SUM(`Drawn`) AS Total_Draws, SUM(`Lost`) AS Total_Losses, AVG(`Points for`) AS Avg_Points_for, AVG(`Points against`) AS Avg_Points_against, AVG(`Tries for`) AS Avg_Tries_for, AVG(`Tries against`) AS Avg_Tries_against, AVG(`Try bonus`) AS Avg_Try_bonus, AVG(`Losing bonus`) AS Avg_Losing_bonus, AVG(`Points`) AS Avg_Total_points 
    FROM `table_1_13399573_4` 
    GROUP BY `Club`;

SELECT `District`, `Incumbent`, `Party`, MAX(`First elected`) AS EarliestElection
FROM `table_1_1341738_36`
GROUP BY `District`, `Incumbent`, `Party`;

SELECT `District`, `Party`, `First elected`, `Result`, `Candidates` 
FROM `table_1_1341884_23` 
WHERE `Result` LIKE '%re-elected%' AND `First elected` >= 1958;

SELECT `District`, `Incumbent`, `Party`, strftime('%Y', `First elected`) AS `Elected Year`
FROM `table_1_1341930_24`
ORDER BY `Elected Year` DESC;

SELECT `District`, `First elected`, `Result`, `Party`
FROM table_1_1342233_3
ORDER BY `District` ASC;

SELECT `District`, `First elected`, `Result` 
     FROM table_1_1342315_4 
     WHERE `First elected` BETWEEN STRFTIME('%Y', '1930-01-01') AND STRFTIME('%Y', '1936-12-31');

SELECT `District`, MAX(`First elected`) AS `LatestElection`
FROM `table_1_1342331_43`
GROUP BY `District`;

SELECT `District`, `Incumbent` AS `Incumbent`, `Party`, `First elected`, `Result`, `Candidates`
FROM `table_1_1342370_10`
WHERE `First elected` = (
    SELECT MIN(`First elected`) 
    FROM `table_1_1342370_10`
);

SELECT T1.`Game`, T1.`Date`, T1.`Team` AS `Home Team`, T2.`Team` AS `Away Team`, T1.`Score`, T1.`High points`, T1.`High rebounds`, T1.`High assists`, T1.`Location Attendance`, T1.`Record`
    FROM `table_1_13557843_5` AS T1
    LEFT JOIN `table_1_13557843_5` AS T2 ON T1.`Game` = T2.`Game` AND T1.`Team`!= T2.`Team`;

SELECT `Club`, SUM(`Played`) AS Total_Played, SUM(`Won`) AS Total_Won, SUM(`Drawn`) AS Total_Drawn, SUM(`Lost`) AS Total_Lost, SUM(`Points for`) AS Total_Points_for, SUM(`Points against`) AS Total_Points_against, SUM(`Tries for`) AS Total_Tries_for, SUM(`Tries against`) AS Total_Tries_against, SUM(`Try bonus`) AS Total_Try_bonus, SUM(`Losing bonus`) AS Total_Losing_bonus, SUM(`Points`) AS Total_Standard_Points 
    FROM `table_1_13564702_3` 
    GROUP BY `Club`;

SELECT `Islands Name`, `Area (sqmi)`, `Area (km 2 )`, `Population (2000)` 
FROM `table_1_13897690_1` 
WHERE `Area (km 2 )` > 10000 AND `Population (2000)` > 100000;

SELECT `T1`.`Call sign`, `T1`.`Network`, `T2`.`Digital channel`
FROM `table_1_1404984_1` AS `T1`
JOIN `table_1_1404984_1` AS `T2` ON `T1`.`Call sign` = `T2`.`Call sign` AND `T1`.`Network` = `T2`.`Network`;

SELECT `Country or territory with flag`, (`Population (July 2009 est.)` / (`Area (km²) (per sqmi)` + `Population density per km²`)) AS `Density Ratio`
    FROM `table_1_14098_1`
    ORDER BY `Density Ratio` DESC;

SELECT `Name`, (`2011 Census` - `2006 Census`) / NULLIF(`2006 Census`, 0) * 100 AS `Percent_Change`
FROM table_1_1425958_1
WHERE `% change` LIKE '%-1%';

SELECT `Country/Territory`, `Former pageant`, `Last competed`, `New pageant`, `Franchise since`
FROM `table_1_14308895_2`
WHERE `Last competed` <= `Franchise since`;

SELECT AVG(T1.`Crowd`)
    FROM `table_1_14312471_3` AS T1
    WHERE T1.`Report` LIKE '%AFL.com.au%';

SELECT `AGR Power Station`, AVG(`Net MWe`) AS Average_MWe, MIN(`Construction started`) AS Earliest_Construction_Start, MAX(`Commercial operation`) AS Latest_Commercial_Operation, MAX(`Accounting closure date`) - MIN(`Construction started`) AS Project_Life_In_Years
    FROM `table_1_143352_1`
    GROUP BY `AGR Power Station`;

SELECT `Player`, `Touchdowns`, `Extra points`, `Field goals`, `Points`
FROM (
    SELECT `Player`, SUM(`Touchdowns`) AS `Touchdowns`, SUM(`Extra points`) AS `Extra points`, SUM(`Field goals`) AS `Field goals`, SUM(`Points`) AS `Points`
    FROM (
        SELECT `Player`, `Touchdowns`, `Extra points`, `Field goals`, `Points`
        FROM `table_1_14341967_2`
    ) AS subquery
    GROUP BY `Player`
) AS subquery2
ORDER BY `Points` DESC;

SELECT `Player`, `Touchdowns (5 points)` * 5 + `Extra points 1 point` AS TotalPoints 
    FROM `table_1_14342367_15` 
    WHERE `Total Points` = (SELECT MAX(`Total Points`) FROM `table_1_14342367_15`);
